import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { getCards, removeCard } from "../../../store/cards";
import FlipCard from "./flipCard";
import PropTypes from "prop-types";
import style from "./flipcard.module.css";

const CardList = () => {
    const cards = useSelector(getCards());
    const dispatch = useDispatch();
    const onHandleDeleteCard = (id) => {
        dispatch(removeCard(id));
    };
    return (
        <div>
            <div className={"d-flex flex-wrap gap-4 " + style.flipCardPosition}>
            { cards?.map((card) =>
                <FlipCard {...card} key={card._id} onHandleDeleteCard={ onHandleDeleteCard } />)
            }
            </div>
        </div>
    );
};

export default CardList;

CardList.propTypes = {
    card: PropTypes.array,
    onHandleDeleteCard: PropTypes.func
};
